The World on a Bike: Uzbekistan

Travel Documentary hosted by Yuri Nakamura, published by NHK in 2014 - English narration


Information
------------------------------

The World on a Bike will take you on a smooth ride in the Republic of Uzbekistan in Central Asia. We head from Tashkent to the ancient capital, Samarkand, the jewel of the Silk Road.

